class CourseMapPageComponent {
    constructor(resourceLoadsService, toastr) {
        this.resourceLoadsService = resourceLoadsService;
        this.toastr = toastr;
        this.config = {
            spaceBetween: this.windowWidth() / 70,
            slidesPerView: 3,
            navigation: {
                nextEl: '.slider-button_right',
                prevEl: '.slider-button_left',
            },
        };
        this.levelMessages = {
            VideoClass: 'Video Aula',
            Problem: 'Problema',
            Challenge: 'Desafio'
        };
    }
    windowWidth() {
        const win = window;
        const doc = document;
        const docElem = doc.documentElement;
        const body = doc.getElementsByTagName('body')[0];
        return win.innerWidth || docElem.clientWidth || body.clientWidth;
    }
    onResize() {
        setTimeout(() => {
            this.sliderHeight = document.getElementById('slider').clientHeight;
        }, 500);
    }
    ngOnInit() {
        this.resourceLoadsService.getCourseMap()
            .then((e) => {
            this.LevelStatusList = e.LevelStatusList;
            this.onResize();
            console.log(e);
        })
            .catch(e => {
            this.toastr.error('Course map is not available', 'Error');
            console.error(e);
        });
        this.resourceLoadsService.getLevelMap()
            .then((e) => {
            this.levelMap = e;
            this.onResize();
            console.log(e);
        })
            .catch(e => {
            this.toastr.error('Course map is not available', 'Error');
            console.error(e);
        });
        this.resourceLoadsService.getDashboard()
            .then((e) => {
            console.log(e);
            this.CurrentGrade = e.Dashboard.CurrentGrade;
            this.GradeColor = e.Dashboard.GradeColor;
        }).catch(e => {
            this.toastr.error('Level map is not available', 'Error');
            console.error(e);
        });
    }
}


